import React from 'react';
import image from "../Images/logoWithoutBG.png";
import image1 from "../Images/Mountain.jpg";

const Header = () => {
    return (
        <>
            <div className={'d-flex '}>
                <div className={'logo'}>
                    <img src={image}/>
                </div>
                <div className={'header'}>
                    <img className={'w-100'} src={image1}/>
                </div>
            </div>
        </>
    );
};

export default Header;
